import "./App.css";
import styled from "styled-commponents";
function App() {
  return (
    <MainContainer>
      <TopContainer>
        <div className="logo">
          <img src="" alt="logo" />
        </div>

        <div className="search">
          <input type="text" placeholder="Search Food" />
        </div>
      </TopContainer>
    </MainContainer>
  );
}

export default App;

const MainContainer = styled.dev``;
const TopContainer = styled.section``;
